import React from 'react'
import { useState } from 'react';
import { withRouter } from "react-router-dom";
import {connect} from 'react-redux'
import { newDepartment } from ".././actions/currentDepartments.js"


const DepartmentNew = ({ newDepartment, history }) => {

	const [form, setForm] = useState({
    name: '',
    service: '',
    charge: '',
    account_id: this.props.account.id 
  });

  const handleNewDepartmentFormChange = (event, target) => {
      setForm({
      ...form,
    [target]: event.target.value, 
   });
    }

   const handleNewDepartmentFormSubmit = (event) => {
	 	event.preventDefault()
	 	newDepartment(form, history);
	 }

	return (
           <div>
             <form onSubmit={handleNewDepartmentSubmit}>
                <label>Department New</label>
                <label>Name:</label>
                <input type="text" 
                        name="name" 
                        value={form.name} 
                        onChange={(event)=> handleLoginFormChange(event, "name")}/>
                <label>Service:</label>
                <input type="text" 
                        name="service" 
                        value={form.service} 
                        onChange={(event)=> handleLoginFormChange(event, "service")}/>
                <label>Charge:</label>
                <input type="text" 
                        name="charge" 
                        value={form.charge} 
                        onChange={(event)=> handleLoginFormChange(event, "charge")}/>
                <input type="submit"/>
             </form> 
           </div>
		)
}

export default connect(null, {newDepartment})(DepartmentNew)
